import React from "react";
import ReactDom from "react-dom";
import { ReactComponent as YourSvg } from "./pin.svg";
import AppHeader from "./components/header/header.js";

//CSS
import "./index.css";
function JobList() {
  return (
    <section className="jobInstance">
      <JobInstance title="Software Engineer, Front-end" />{" "}
      <JobInstance title="Software Engineer, Back-end" />
      <JobInstance title="AI Researcher" />
      <JobInstance title="" />{" "}
    </section>
  );
}

ReactDom.render(<JobList />, document.getElementById("root"));
